import { Container } from 'react-bootstrap';
import './test.css';

function Test(){

    let message = "Привет, мир!"

    return(
        <div>
            <Container fluid>
                <div className = "container">
                    <h1>Сообщение</h1>
                    <button onClick={() =>{
                        alert('Message')
                    }} className = "button">
                        Нажми на меня
                    </button>
                </div>
            </Container>
        </div>
    )
}

export default Test
